import "./Cuisines_box.css"
import CuisinesInner from "../Cuisines_inner/Cuisines_inner"
const CuisinesBox=()=>{
    return(
        <section class="container-flex img-box-flex">
    
            <CuisinesInner typeFood="کباب" image="https://dist.reyhoon-static.com/uploads/images/cuisines/kebab_1525012065.jpeg@!cuisine_card" activeNumber="1836"/>
            <CuisinesInner typeFood="پیتزا" image="https://dist.reyhoon-static.com/uploads/images/cuisines/pizza_1539780235.jpeg@!cuisine_card." activeNumber="1836"/>
            <CuisinesInner typeFood="برگر" image="https://dist.reyhoon-static.com/uploads/images/cuisines/hamburger_1539779150.jpeg@!cuisine_card" activeNumber="1836"/>
            <CuisinesInner typeFood="ساندویچ" image="https://dist.reyhoon-static.com/uploads/images/cuisines/sandwich_1539782856.jpeg@!cuisine_card" activeNumber="1836"/>


            </section> 
    
    )
    }
    export default CuisinesBox;
